//import React, { useRef, useState, useMemo } from "react";


import React, { useReducer } from "react";


let value = {
    age:0
}

let reduser = (State, action) => {
    if(action.type === "incremented") {
        return {
            age: State.age + 1
        }
    }
}


let counter = () => {
    let [State, dispatch] = useReducer(reduser, value)
    return (
        <>
            <button onClick={ () => dispatch({
                type: "incremented"
            })}>incremented age</button>
            <span> you are age: {State.age} </span>
        </>
    )
}



export default counter










